import time
def fibonacci(n, mem):
	if (n == 0 or n == 1):
		return 1
	if (mem[n] == -1):
		mem[n] = fibonacci(n-1, mem) + fibonacci(n-2, mem)
	return mem[n]

def main(args):
	start = time.time()
	n = int(args.get('fib_n'))
	mem = [-1 for i in range(n+1)]
	result = fibonacci(n, mem)
	key = 'Fibonacci of n == ' + str(n)
	end = time.time()
	return {key: result,'time': end-start}
